import React from 'react';
import './App.css';
import HomePage from "./pages/HomePage"
import { Route, withRouter, Link, Redirect } from "react-router";

function App() {
  return (
    <div className="App">
      <Route path="/" exact component={HomePage}></Route>
    </div>
  );
}

export default App;
